import React, { useState, useEffect } from 'react';
import axios from 'axios';
import NavBar from "./NavBar";

function AllBeers() {
  const [beerData, setData] = useState([]);

  useEffect(() => {
    const beers = axios.get('http://localhost:8000/all_beers')
      .then(response => {
        setData(beers.data)
      })
      .catch(error => {
        console.log(error);
      });
  }, []);


    return (

      <div>
          <NavBar/>
          <h1>Beers</h1>
          {beerData.map((beer) =>
               <h1>{beer.name}</h1>)
          }

      </div>
  );
}

export default AllBeers;
